on Carnero Reversible 60X90cm<br />\r\n(9) Cobertor para mascotas Piel de durazno con Carnero Reversible 90X120cm<br />\r\n(10) Cobertor para mascotas Piel de durazno con Carnero Reversible 120X150cmColores: Diversidad de colores al gusto del cliente (seg&uacute;n stock)<br />\r\nCONFECCIONAMOS TALLAS ESPECIALES AL GUSTO Y NECESIDAD DE NUESTROS CLIENTES<br />\r\nEn MAKIPURATC, tenemos stock disponible de cualquiera de los productos relacionados, consultar<br />\r\n&quot;&quot;VENTAS POR MENOR Y MAYOR&quot;&quot;<br />\r\n<br />\r\n********************************************************************************************************<br />\r\n<br />\r\nPRECIO PROMOCI&Oacute;N *** OFERTA **<br />\r\nCOMPRAS POR DOCENAS: 5% DESCUENTO<br />\r\nCOMPRAS POR 50 UNIDADES 10% DESCUENTO<br />\r\nDESCUENTOS ESPECIALES POR COMPRAS DE MAS DE 100 UNIDADES<br />\r\n<br />\r\n********************************************************************************************************<br />\r\nUSOS:<br />\r\n- Est&aacute; reservado pr&aacute;cticamente para uso en el Hogar<br />\r\n- Para proteger del frio intenso a nuestras mascotas<br />\r\n<br />\r\n&iquest;C&Oacute;MO COMPRAR?<br />\r\n1. Haga todas las preguntas necesarias antes de efectuar la compra.<br />\r\n2. Dele click en comprar cuando est&eacute; 100% seguro de adquirir el producto.<br />\r\n3. Seleccione el m&eacute;todo de entrega de su preferencia.<br />\r\n4. Seleccione el m&eacute;todo de pago de su preferencia.<br />\r\n5. Reciba su producto en la comodidad de su hogar o ret&iacute;relo en nuestros puntos de entrega<br />\r\n6.- COMPRE AL POR MAYOR TAMBI&Eacute;N: Consulte sus descuentos.<br />\r\n<br />\r\nCONF&Iacute;ANOS LA ENTREGA DE TUS PEDIDOS:<br />\r\n<br />\r\nLima:<br />\r\n- Sin costo entrega en nuestra planta de la Molina<br />\r\n- Distritos de Lima:<br />\r\n* Entrega en estaci&oacute;n Cultura del Tren o el Jockey Plaza (lunes/mi&eacute;rcoles/viernes 9:30) S/. 6.00<br />\r\n* Delivery a direcci&oacute;n exacta de su preferencia, por TAXI GARANTIZADO, pago en destino.<br />\r\n* Zonas perif&eacute;ricas env&iacute;o por OLVA CUOURIER S/. 25.00<br />\r\n- *Provincia: Delivery hasta la Agencia de Transporte (S/. 15.00)<br />\r\nAgencias de transportes interprovinciales a todos los destinos del Per&uacute; con la modalidad PAGO en DESTINO.<br />\r\n<br />\r\nNota.- Para los despachos a provincias nuestra responsabilidad culmina con la entrega del pedido a la Agencia de Transportes de carga y remisi&oacute;n a nuestra distinguida clientela del comprobante de env&iacute;o. La mercader&iacute;a viaja por cuenta y riesgo del cliente.<br />\r\n<br />\r\nEL PAGO ES POR MERCADO PAGO, CON LO CUAL SU DINERO ESTA PROTEGIDO TOTALMENTE<br />\r\nENTREGAS EN 48 HORAS<br />\r\n<br />\r\nTRANSFERENCIAS Y DEP&Oacute;SITOS:<br />\r\nEfect&uacute;e el dep&oacute;sito en Agentes o Cajeros.<br />\r\n- Banco de Cr&eacute;dito - BCP<br />\r\n- Banco Continental - BBVA<br />\r\n- Banco Internacional - Interbank<br />\r\n- Scotiabank Per&uacute; - Scotiabank.<br />\r\n<br />\r\nNota.- Para el caso de dep&oacute;sitos en provincias (Cajeros y Agencias Bancarias), considerar la comisi&oacute;n de abono fuera de Lima de un monto de S/. 9.00 adicional (Comisi&oacute;n Interplaza).</p>', 'Para los despachos a provincias nuestra responsabilidad culmina con la entrega del pedido a la Agencia de Transportes de carga y remisión a nuestra distinguida clientela del comprobante de envío', 'products/wheGlacPpjxYls1GgvBQUWjYBx0Hqh7j5rhpxB6a.webp', 2, '[{\"item_id\": 1705985387333, \"item_text\": \"MAKIPURATC\"}, {\"item_id\": 1705985390134, \"item_text\": \"Mascotas\"}, {\"item_id\": 1705985400430, \"item_text\": \"Cobertor Para Mascotas\"}]', 9, 35, NULL, NULL, 30, '2024-01-23 04:51:20', '2024-01-23 09:51:31', NULL),
