(25, 'APPLE AIRPODS PRO 2ND GENERACIÓN', 'apple-airpods-pro-2nd-generacion', 'AIRPODS P-346', 929, 375, '<p>(2nd Generaci&oacute;n) Con funda de carga MagSafe. Cancelaci&oacute;n activa de ruido, audio espacial personalizado, ajuste personalizable, auriculares Bluetooth para iPhone. Garantia Internacional de Apple</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tipo de producto</td>\r\n			<td>Aud&iacute;fonos</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Alto (cm)</td>\r\n			<td>6.0705999999999998</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ancho (cm)</td>\r\n			<td>4.5212000000000003</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Largo (cm)</td>\r\n			<td>2.1589999999999998</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Garant&iacute;a</td>\r\n			<td>12 MESES</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Marca</td>\r\n			<td>APPLE</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Peso (kg)</td>\r\n			<td>4.8999999999999998E-3</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'ENCUENTRA CON FUNDA DE CARGA MAGSAFE.CANCELACIÓN ACTIVA DE RUIDO,AUDIO ESPACIAL PERSONALIZADO,AJUSTE PERSONALIZABLE,AURICULARES BLUETOOTH PARA IPHONE,EN RIPLEYPERÚ ¡COMPRAONLINE!', 'products/rQj7FDnhDlSnKexhvGhKiAojczMsyuAdghieh3FD.avif', 2, '[{\"item_id\": 1705988219127, \"item_text\": \"AIRPODS\"}]', 7, 11, NULL, NULL, 18, '2024-01-23 05:38:13', '2024-01-23 10:38:54', NULL),
(26, 'SECCIONAL RIPLEY HOME FRANCA GRIS DERECHA', 'seccional-ripley-home-franca-gris-derecha', '2064260167734', 899, 276, '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Marca</td>\r\n			<td>RIPLEY HOME</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Peso (kg)</td>\r\n			<td>52</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tipo de producto</td>\r\n			<td>Seccionales</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Alto (cm)</td>\r\n			<td>78</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ancho (cm)</td>\r\n			<td>84</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Profundidad del asiento (cm)</td>\r\n			<td>-</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ancho del brazo (cm)</td>\r\n			<td>-</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Largo (cm)</td>\r\n			<td>217</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Profundidad del chaise longue (cm)</td>\r\n			<td>-</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Producto hecho a pedido</td>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Modelo</td>\r\n			<td>Franca</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Material de la estructura</td>\r\n			<td>Madera</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Material del tapiz</td>\r\n			<td>Tela 100% poliester tipo lino</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reclinable</td>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cantidad de cuerpos</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tipo de seccional</td>\r\n			<td>Libre disposici&oacute;n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Encuentra la comodidad que buscas para tu familia y amigos con los nuevos muebles que ofrece nuestra marca Ripley Home. Modelos originales que le dar&aacute;n el toque de armon&iacute;a a los espacios de tu hogar.</p>\r\n\r\n<p>Muebles fabricados con los mejores materiales haci&eacute;ndolo un producto perdurable.</p>', 'Encuentra la comodidad que buscas para tu familia y amigos con los nuevos muebles que ofrece nuestra marca Ripley Home', 'products/BzZC1AEp5sqpMNsYpjd9aQMIoYrEVyfWk3GrGNsw.jpg', 2, '[{\"item_id\": 1705988572765, \"item_text\": \"SECCIONAL RIPLEY\"}, {\"item_id\": 1705988581574, \"item_text\": \"FRANCA GRIS\"}]', 17, 30, NULL, NULL, 19, '2024-01-23 05:44:14', '2024-01-23 10:44:40', NULL),
(27, 'Samsung Galaxy S23 Ultra Dual SIM 256 GB phantom black 12 GB RAM', 'samsung-galaxy-s23-ultra-dual-sim-256-gb-phantom-black-12-gb-ram', 'Dual-SIM-256-GB', 3799, 1580, '<p>Fotograf&iacute;a profesional en tu bolsillo<br />\r\nDescubre infinitas posibilidades para tus fotos con las 4 c&aacute;maras principales de tu equipo. Pon a prueba tu creatividad y juega con la iluminaci&oacute;n, diferentes planos y efectos para obtener grandes resultados.<br />\r\n<br />\r\nExperiencia visual incre&iacute;ble<br />\r\nMira tus series y pel&iacute;culas favoritas con la mejor definici&oacute;n a trav&eacute;s de su pantalla AMOLED de 6.8&quot;. Disfruta de colores brillantes y detalles precisos en todos tus contenidos.<br />\r\n<br />\r\nCapacidad y eficiencia<br />\r\nCon su potente procesador y memoria RAM de 12 GB tu equipo alcanzar&aacute; un alto rendimiento con gran velocidad de transmisi&oacute;n de contenidos y ejecutar&aacute; m&uacute;ltiples aplicaciones a la vez sin demoras.<br />\r\n<br />\r\nDesbloqueo facial y dactilar<br />\r\nM&aacute;xima seguridad para que solo t&uacute; puedas acceder al equipo. Podr&aacute;s elegir entre el sensor de huella dactilar para habilitar el tel&eacute;fono en un toque, o el reconocimiento facial que permite un desbloqueo hasta un 30% m&aacute;s r&aacute;pido.<br />\r\n<br />\r\nBater&iacute;a de duraci&oacute;n superior<br />\r\n&iexcl;Desench&uacute;fate! Con la s&uacute;per bater&iacute;a de 5000 mAh tendr&aacute;s energ&iacute;a por mucho m&aacute;s tiempo para jugar, ver series o trabajar sin necesidad de realizar recargas.</p>', 'Descubre infinitas posibilidades para tus fotos con las 4 cámaras principales de tu equipo. Pon a prueba tu creatividad y juega con la iluminación, diferentes planos', 'products/5ZYGrVdVopdWA9Tiz8uPZ52PN3xgKyqsKaUcp51k.webp', 2, '[{\"item_id\": 1705989054704, \"item_text\": \"Ultra Dual SIM 256 GB\"}, {\"item_id\": 1705989057945, \"item_text\": \"Samsung Galaxy S23\"}, {\"item_id\": 1705989060992, \"item_text\": \"12 GB RAM\"}]', 2, 29, NULL, NULL, 23, '2024-01-23 05:52:16', '2024-12-06 19:28:02', NULL),
(28, 'Backbone One Xbox Series Edition Android Black', 'backbone-one-xbox-series-edition-android-black', 'Android-Black125F', 540, 125, '<p>Somos una tienda virtual que comercializa diversas categor&iacute;as de productos de importaci&oacute;n.<br />\r\n<br />\r\nNOTA!!!!! : Este controlador tiene conector USB-C para celulares Android y para los nuevos modelos de Iphone 15, si usted tiene un modelo de Iphone numero 14 o menor debe adquirir el controlador con conector lightning.<br />\r\n<br />\r\nATENCION:<br />\r\nSolo para los modelos Iphone 15 en algunos casos se necesitara una actualizaci&oacute;n en caso de no responder los botones en la configuraci&oacute;n inicial para esto usted debe: conectar a cualquier tel&eacute;fono Android e inicias la aplicaci&oacute;n Backbone, deber&iacute;a tardar unos 30 segundos en actualizarse y arreglarse.<br />\r\nDebido a la nueva tecnolog&iacute;a de Apple, el controlador no reconocer&aacute; el iPhone 15 antes de que se actualice el firmware<br />\r\n<br />\r\n<br />\r\nBackbone One transforma tu tel&eacute;fono Android y los modelos del nuevo iPhone 15 en la consola de juegos definitiva. Conecta tu tel&eacute;fono y juega a cualquier juego o servicio que sea compatible con un controlador, incluidos t&iacute;tulos nativos para dispositivos m&oacute;viles y Xbox Game Pass Ultimate. Tambi&eacute;n podr&aacute;s transmitir desde tu Xbox o PC. La aplicaci&oacute;n Backbone organiza tu biblioteca de contenidos y los servicios de transmisi&oacute;n de juegos en una experiencia de usuario integrada. Descubre un nuevo mundo de juego de primera calidad en segundos.<br />\r\n<br />\r\nEl controlador Backbone One (USB-C) es compatible con los dispositivos m&oacute;viles con puerto USB-C m&aacute;s populares de Apple, Samsung, Google, Xiaomi, Oppo, Vivo, Huawei, realme y Motorola, incluidos los modelos del nuevo iPhone 15.<br />\r\n<br />\r\nBACKBONE One Gaming Controller for Android /original. Producto Nuevo y Sellado.<br />\r\n<br />\r\nNOTAS IMPORTANTES:<br />\r\n* Forma de Pago: Mercado Pago.<br />\r\n* Env&iacute;os/Entregas:<br />\r\n1. Mercado env&iacute;os Flex: Si la publicaci&oacute;n indica &ldquo;LLEGA HOY&rdquo;, se coordinar&aacute; la entrega en el mismo d&iacute;a entre las 2:00 pm &ndash; 8:00 pm.<br />\r\n2.Mercado Env&iacute;os: para Lima llega dentro de 2 a 3 d&iacute;as y para Provincia dentro de 3 a 5 d&iacute;as aproximadamente. Este tipo de env&iacute;os los realiza mercado libre con un Courier propio de ellos por lo cual los tiempos lo manejan ellos y no el vendedor.<br />\r\n3. Recojo en oficina: Realice su compra y rec&oacute;jalo en nuestro almac&eacute;n en Miraflores (previa coordinaci&oacute;n). Para este tipo de recojo en oficina debe escoger la opci&oacute;n &ldquo;RETIRAR COMPRA EN EL DOMICILIO DEL VENDEDOR&rdquo;</p>', 'Este controlador tiene conector USB-C para celulares Android y para los nuevos modelos de Iphone 15, si usted tiene un modelo de Iphone numero 14 o menor debe adquirir el controlador con conector lightning', 'products/Rq0OJZvzRtPsX6e1u7FRRHOBFyhlZ9fDP6K6clf0.webp', 2, '[{\"item_id\": 1705989989205, \"item_text\": \"Android Black\"}, {\"item_id\": 1705989993590, \"item_text\": \"Backbone One Xbox\"}]', 19, 1, 2, 6, 23, '2024-01-23 06:07:55', '2024-01-23 11:08:08', NULL),
(29, 'Nintendo Switch OLED The Legend of Zelda: Tears of the Kingdom Edition', 'nintendo-switch-oled-the-legend-of-zelda-tears-of-the-kingdom-edition', 'Nintendo-Switch124F3R', 1799, 650, '<p>Con tu consola Switch tendr&aacute;s entretenimiento asegurado todos los d&iacute;as. Su tecnolog&iacute;a fue creada para poner nuevos retos tanto a jugadores principiantes como expertos.<br />\r\n<br />\r\nSwitch se convirti&oacute; en una de las consolas m&aacute;s vers&aacute;tiles del mercado gracias a su uso port&aacute;til y de sobremesa. Nintendo desarroll&oacute; este modelo con el objetivo de tener todas las comodidades de la tecnolog&iacute;a de elite en un aparato port&aacute;til con el que podr&aacute;s jugar y disfrutar de diverso contenido online.<br />\r\n<br />\r\nLos Joy-con cuentan con botones especiales para realizar print de pantalla. Adem&aacute;s, posee una c&aacute;mara infrarroja que puede leer la distancia respecto a los objetos e incluso detectar formas.<br />\r\n<br />\r\nAdaptada a tus necesidades<br />\r\nGuarda tus apps, fotos, videos y mucho m&aacute;s en el disco duro, que cuenta con una capacidad de 64 GB.<br />\r\nAl contar con un procesador de 8 n&uacute;cleos y uno gr&aacute;fico, brinda una experiencia din&aacute;mica, respuestas &aacute;giles, y transiciones fluidas de im&aacute;genes en alta definici&oacute;n.<br />\r\nPor otro lado, tiene puerto USB y salida HDMI, que permiten conectar accesorios y cargar la bater&iacute;a de tu control mientras juegas.<br />\r\n<br />\r\nVas a poder reproducir m&uacute;sica, ver tus pel&iacute;culas y series favoritas a trav&eacute;s de las aplicaciones descargables.</p>', 'Con tu consola Switch tendrás entretenimiento asegurado todos los días. Su tecnología fue creada para poner nuevos retos tanto a jugadores principiantes como expertos', 'products/zqAlnvUay1EncroqmUYyVgJMe2yhKlqxxTuxh6Bp.webp', 2, '[{\"item_id\": 1705990388597, \"item_text\": \"Kingdom Edition\"}, {\"item_id\": 1705990393414, \"item_text\": \"Nintendo Switch\"}]', 20, 1, 2, 4, 27, '2024-01-23 06:15:01', '2024-12-06 13:21:11', NULL);
